import React, { Component } from 'react';
import './school.css';

class School extends Component {
    constructor(){
        super();
        this.state = {
            schools: [],
        }
    }

    render() {
        return (
            <div>
                <h2>{this.props.name}</h2>
                <p>{this.props.location}</p>
                <p>{this.props.gpa}</p>
                <p>{this.props.concentration}</p>
                <p>{this.props.activities}</p>
            </div>
        );
    }
}

export default School;
